const PersonalData = () => (
    <div className="container" id="datos">
        <h1>Datos Personales</h1>
        <ul>
            <li>Nombre: Luis Manuel</li>
            <li>Apellido: Brito Romero</li>
            <li>Cedula: 21281.544</li>
            <li>Telefono</li>
            <li>Direccion</li>
            <li>Email</li>
        </ul>
    
            <style jsx> {`
            .container{
                border: 1px solid red;
                margin: 20px;
            }
            .container ul{
                color: red;
                text-decoration: none;
            }

            `}
            </style>
    </div>
);

export default PersonalData;
